(lib.number = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		var numMc = this;
		var digits = [];
		var dx = 2.25;
		var pool = [];
		var align='left';
		var value;
		
		function setNumber(num) {
			num = parseInt(num);
			value = num;
			numMc.removeAllChildren();
			var x = 0;
			var len = num.toString().length;
			for (var a=Math.pow(10, len), b=a/10, i=0; i < len; i++, a /= 10, b /= 10) {
				var id = parseInt(num % a / b);
				if (!pool[i*10+id]) pool[i*10+id] = new lib['n'+id]()
				var digit = pool[i*10+id];
				digit.x = x;		
				x += digit.getBounds().width + dx - 4;		
				numMc.addChild(digit);
			}
			var width = numMc.getBounds().width;
			if (align == 'right') {
				for (var i=0; i < numMc.numChildren; i++) {
					numMc.children[i].x -= width;
				}		
			}	
		}
		
		Object.defineProperty(this, 'align', {
			get: () => {return align},
			set: (value) => {align = value}
		});
		
		Object.defineProperty(this, 'value', {
			get: () => {return value},
			set: setNumber
		});
		
		//this.set = setNumber;
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

}).prototype = getMCSymbolPrototype(lib.number, new cjs.Rectangle(0,0,0,0), null);


